# IrohError
# We want to define each variant as a nested class that's also a subclass,
# which is tricky in Python.  To accomplish this we're going to create each
# class separately, then manually add the child classes to the base class's
# __dict__.  All of this happens in dummy class to avoid polluting the module
# namespace.
class IrohError(Exception):
    pass

UniFFITempIrohError = IrohError

class IrohError:  # type: ignore
    class Runtime(UniFFITempIrohError):
        def __init__(self, description):
            super().__init__(", ".join([
                "description={!r}".format(description),
            ]))
            self.description = description
        def __repr__(self):
            return "IrohError.Runtime({})".format(str(self))
    UniFFITempIrohError.Runtime = Runtime  # type: ignore
    class NodeCreate(UniFFITempIrohError):
        def __init__(self, description):
            super().__init__(", ".join([
                "description={!r}".format(description),
            ]))
            self.description = description
        def __repr__(self):
            return "IrohError.NodeCreate({})".format(str(self))
    UniFFITempIrohError.NodeCreate = NodeCreate  # type: ignore
    class Doc(UniFFITempIrohError):
        def __init__(self, description):
            super().__init__(", ".join([
                "description={!r}".format(description),
            ]))
            self.description = description
        def __repr__(self):
            return "IrohError.Doc({})".format(str(self))
    UniFFITempIrohError.Doc = Doc  # type: ignore
    class Author(UniFFITempIrohError):
        def __init__(self, description):
            super().__init__(", ".join([
                "description={!r}".format(description),
            ]))
            self.description = description
        def __repr__(self):
            return "IrohError.Author({})".format(str(self))
    UniFFITempIrohError.Author = Author  # type: ignore
    class DocTicket(UniFFITempIrohError):
        def __init__(self, description):
            super().__init__(", ".join([
                "description={!r}".format(description),
            ]))
            self.description = description
        def __repr__(self):
            return "IrohError.DocTicket({})".format(str(self))
    UniFFITempIrohError.DocTicket = DocTicket  # type: ignore
    class Uniffi(UniFFITempIrohError):
        def __init__(self, description):
            super().__init__(", ".join([
                "description={!r}".format(description),
            ]))
            self.description = description
        def __repr__(self):
            return "IrohError.Uniffi({})".format(str(self))
    UniFFITempIrohError.Uniffi = Uniffi  # type: ignore

IrohError = UniFFITempIrohError  # type: ignore
del UniFFITempIrohError


class FfiConverterTypeIrohError(FfiConverterRustBuffer):
    @staticmethod
    def read(buf):
        variant = buf.readI32()
        if variant == 1:
            return IrohError.Runtime(
                description=FfiConverterString.read(buf),
            )
        if variant == 2:
            return IrohError.NodeCreate(
                description=FfiConverterString.read(buf),
            )
        if variant == 3:
            return IrohError.Doc(
                description=FfiConverterString.read(buf),
            )
        if variant == 4:
            return IrohError.Author(
                description=FfiConverterString.read(buf),
            )
        if variant == 5:
            return IrohError.DocTicket(
                description=FfiConverterString.read(buf),
            )
        if variant == 6:
            return IrohError.Uniffi(
                description=FfiConverterString.read(buf),
            )
        raise InternalError("Raw enum value doesn't match any cases")

    @staticmethod
    def write(value, buf):
        if isinstance(value, IrohError.Runtime):
            buf.writeI32(1)
            FfiConverterString.write(value.description, buf)
        if isinstance(value, IrohError.NodeCreate):
            buf.writeI32(2)
            FfiConverterString.write(value.description, buf)
        if isinstance(value, IrohError.Doc):
            buf.writeI32(3)
            FfiConverterString.write(value.description, buf)
        if isinstance(value, IrohError.Author):
            buf.writeI32(4)
            FfiConverterString.write(value.description, buf)
        if isinstance(value, IrohError.DocTicket):
            buf.writeI32(5)
            FfiConverterString.write(value.description, buf)
        if isinstance(value, IrohError.Uniffi):
            buf.writeI32(6)
            FfiConverterString.write(value.description, buf)





class LiveEvent:
    def __init__(self):
        raise RuntimeError("LiveEvent cannot be instantiated directly")

    # Each enum variant is a nested class of the enum itself.
    class INSERT_LOCAL:
        def __init__(self,):
            
            pass
            

        def __str__(self):
            return "LiveEvent.INSERT_LOCAL()".format()

        def __eq__(self, other):
            if not other.is_insert_local():
                return False
            return True
    class INSERT_REMOTE:
        def __init__(self,):
            
            pass
            

        def __str__(self):
            return "LiveEvent.INSERT_REMOTE()".format()

        def __eq__(self, other):
            if not other.is_insert_remote():
                return False
            return True
    class CONTENT_READY:
        def __init__(self,):
            
            pass
            

        def __str__(self):
            return "LiveEvent.CONTENT_READY()".format()

        def __eq__(self, other):
            if not other.is_content_ready():
                return False
            return True
    

    # For each variant, we have an `is_NAME` method for easily checking
    # whether an instance is that variant.
    def is_insert_local(self) -> bool:
        return isinstance(self, LiveEvent.INSERT_LOCAL)
    def is_insert_remote(self) -> bool:
        return isinstance(self, LiveEvent.INSERT_REMOTE)
    def is_content_ready(self) -> bool:
        return isinstance(self, LiveEvent.CONTENT_READY)
    

# Now, a little trick - we make each nested variant class be a subclass of the main
# enum class, so that method calls and instance checks etc will work intuitively.
# We might be able to do this a little more neatly with a metaclass, but this'll do.
LiveEvent.INSERT_LOCAL = type("LiveEvent.INSERT_LOCAL", (LiveEvent.INSERT_LOCAL, LiveEvent,), {})  # type: ignore
LiveEvent.INSERT_REMOTE = type("LiveEvent.INSERT_REMOTE", (LiveEvent.INSERT_REMOTE, LiveEvent,), {})  # type: ignore
LiveEvent.CONTENT_READY = type("LiveEvent.CONTENT_READY", (LiveEvent.CONTENT_READY, LiveEvent,), {})  # type: ignore




class FfiConverterTypeLiveEvent(FfiConverterRustBuffer):
    @staticmethod
    def read(buf):
        variant = buf.readI32()
        if variant == 1:
            return LiveEvent.INSERT_LOCAL(
            )
        if variant == 2:
            return LiveEvent.INSERT_REMOTE(
            )
        if variant == 3:
            return LiveEvent.CONTENT_READY(
            )
        raise InternalError("Raw enum value doesn't match any cases")

    def write(value, buf):
        if value.is_insert_local():
            buf.writeI32(1)
        if value.is_insert_remote():
            buf.writeI32(2)
        if value.is_content_ready():
            buf.writeI32(3)






